import styled from "styled-components";

export default function Item() {
    return(
        <ItemBox>
            <img src="https://a-static.mlcdn.com.br/280x210/apple-iphone-13-128gb-estelar-tela-61-12mp-ios/magazineluiza/234661900/a783ddbd0a2cdce3a0b21bb2c90bbad3.jpg" alt="Items" width="135" height="150" />
            <h2>R$ 1047</h2>
            <span>Iphone 13 256GB Verde</span>
        </ItemBox>
    );
}
const ItemBox = styled.div`
    display: flex;
    flex-direction: column;
    padding: 5px;
    background-color: #FFFFFF;
    border: 1px solid;
    border-radius: 12px;
    h2 {
        display: inline-block;
        margin: 5px 10px;
        color: #010035;
        font-family: 'Mark Pro', sans-serif;
        font-size: 18px;
        font-weight: bold;
    }
    span {
        display: inline-block;
        margin: 0px 10px;
        color: #010035;
        font-size: 12px;
        font-family: 'Mark Pro', sans-serif;
    }
`
